	add("potash", "{\"term\":\"potash\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027Potash\u0027 comes from the word \u0027potasch\u0027 (in modern spelling potas), coined by the Dutch in 1598. The literal translation is \u0027pot ash\u0027, because it was made by burning wood to ashes in a large pot. The English word \u0027Potash\u0027 dates back to 1648.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the water-soluble part of the ash formed by burning plant material; used for making soap, glass and as a fertilize\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"an impure form of potassium carbonate (K\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;CO\u0026lt;sub\u0026gt;3\u0026lt;/sub\u0026gt;) mixed with other potassium salt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"in the names of compounds of the form \u0026quot;... of potash\u0026quot;, potassium (for example, \u0026quot;permanganate of potash\u0026quot; \u003d potassium permanganate\", \"priority\":3}]}, \"synonyms\":{}}");

