	add("poteen", "{\"term\":\"poteen\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Irish\"], \"text\":\"From Irish \u0027poitín\u0027 (little pot)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Illegally produced Irish whiskey; moonshine\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1835\u0027\u0027, Philip Dixon Hardy, \u0027The \u0027\u0027Poteen\u0027\u0027 Still: A Tale Founded on Fact\u0027, in \u0027The Dublin Penny Journal\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Irish peasantry practice the distillation of that illicit spirituous liquor, so well known by the name of \u0027\u0027\u0027poteen\u0027\u0027 whiskey\u0027, with a most unaccountable infatuation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1907\u0027\u0027, w:John Millington John Millington Synge, \u0027s:The Aran Islands/Part The Aran Islands\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“Make haste now and go up and tell your mother to hide the \u0027\u0027poteen\u0027\u0027”—his mother used to sell \u0027\u0027poteen\u0027\u0027—“for I’m after seeing the biggest party of peelers and yeomanry passing by on the rocks was ever seen on the island\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Joseph O\u0027Connor, \u0027Star of the Sea\u0027, Vintage 2003, page 92\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He began to rove the country at night, trudging out to shebeens or crossroads dances, to the ceilidhs and \u0027\u0027poteen\u0027\u0027 sessions that sometimes followed Fair Days in the small towns of Connemara.Category:English words suffixed with -een\", \"priority\":7}]}, \"synonyms\":{}}");

	add("potentate", "{\"term\":\"potentate\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027potentat\u0027, from Old french (842-ca. 1400) from \u0027potentātus\u0027 (rule, political power) from Latin \u0027potēns\u0027 (powerful, strong) the active present participle of \u0027possum\u0027 (i am able)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A powerful leader; a monarch; a rule\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1592\u0027\u0027, w:William Shakespeare, \u0027Henry VI, Part I\u0027, act iii, scene\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But Kings and mightieſt \u0027\u0027Potentates\u0027\u0027 muſt die,\u0026lt;br/\u0026gt;For that\u0027s the end of humane miſerie\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027, w:Theodore Theodore Dreiser, \u0026quot;Sister Carrie\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She was now one of a group of oriental beauties who, in the second act of the comic opera, were paraded by the vizier before the new \u0027\u0027potentate\u0027\u0027 as the treasures of his harem\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A powerful polity or institution\", \"priority\":6}]}, \"synonyms\":{}}");

