	add("pother", "{\"term\":\"pother\", \"etymology\":{\"influencers\":[], \"languages\":[\"Dutch\"], \"text\":\"Origin {{unk.|en|title\u003duncertain}}. Compare Dutch \u0027peuteren|lang\u003dnl\u0027 () and English \u0027potter\u0027 \u0027pudder\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A commotion, a tempest\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1605\u0027\u0027, William Shakespeare, \u0027King Lear\u0027 III.ii\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Let the great gods, / That keep this dreadful \u0027\u0027pother\u0027\u0027 o’er our heads, / Find out their enemies now\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1941\u0027\u0027, Lewiston Morning Tribune, [http://news.google.com/newspapers?id\u003dLMNeAAAAIBAJ\u0026amp;sjid\u003dvzEMAAAAIBAJ\u0026amp;dq\u003dpother\u0026amp;pg\u003d3223%2C3552112 14th of May\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"name of the article) Flight Of Hess Causes \u0027\u0027Pother\u0027\u0027 Among Germans\", \"priority\":5}]}, \"synonyms\":{}}");

