	add("potion", "{\"term\":\"potion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027pocioun\u0027 from Old french (842-ca. 1400) \u0027pocion\u0027 from Latin \u0027pōtiō\u0027 (a drinking) \u0027potionis\u0027, from \u0027pōtāre\u0027 (to drink)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small portion or dose of a liquid which is medicinal, poisonous, or magical\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He hoped to win the princess’s heart by mixing the love \u0027\u0027potion\u0027\u0027 the witch gave him into her drink\", \"priority\":2}]}, \"synonyms\":{}}");

	add("potiphar", "{\"term\":\"potiphar\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient hebrew\"], \"text\":\"From Ancient hebrew \u0027פּוֹטִיפַר\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An Egyptian and captain of the guard under Pharaoh\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"And Joseph was brought down to Egypt; and \u0027\u0027Potiphar\u0027\u0027, an officer of Pharaoh, captain of the guard, an Egyptian, bought him of the hands of the Ishmaelites, which had brought him down thither\", \"priority\":2}]}, \"synonyms\":{}}");

