	add("potterholic", "{\"term\":\"potterholic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Potter|holic|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who loves the \u0027\u0027 series of books and films\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Charlie Fletcher, \u0026quot;[http://www.highbeam.com/doc/1P2-18639672.html Has Potter movie magic lost its spell?]\u0026quot;, \u0027Scotland on Sunday\u0027, 25 November 2001\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"My eight-year-old, as die-hard a \u0027\u0027Potterholic\u0027\u0027 as they come, a kid who can probably remember Hogwarts minutiae that even JK has forgotten, walked out of the multiplex and gave it a five out of 10\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Melissa Anelli, \u0027Harry, A History\u0027, Pocket Books (2008), ISBN 9781416554950, [http://books.google.com/books?id\u003dE5V4zfHYaw0C\u0026amp;pg\u003dPA103\u0026amp;dq\u003d%22potterholics%22 page 103\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"By the time the doors were ready to open, the \u0027\u0027Potterholics\u0027\u0027 had managed to transform the bland room, with its gray-knotted carpet and vaulted ceiling, into a dark and chapelesque space, hung with streamers and Hogwarts house banners, and a looped clip of floating candles from the Harry Potter movies playing on the wall\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Sangeetha Alagappan, \u0026quot;[http://gulfweekly.com/Articles.aspx?articleid\u003d26026 Casting a spell over Bahrain]\u0026quot;, \u0027Gulf Weekly\u0027, Volume 9, Issue 47, 24 November - 30 November 2010\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"As a \u0027\u0027Potterholic\u0027\u0027 myself, clad in a Gryffindor scarf, wand tucked into my front pocket, armed with the first and best tickets for the first showing, I waited impatiently for the movie to begin\", \"priority\":7}]}, \"synonyms\":{}}");

	add("potterite", "{\"term\":\"potterite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Potter|ite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who loves the \u0027\u0027 series of books and films\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Connie Ann Kirk, \u0027J. K. Rowling: A Biography\u0027, Greenwood Press (2003), ISBN 0313322058, [http://books.google.ca/books?id\u003dGJgbW9c9mpwC\u0026amp;pg\u003dPA24\u0026amp;dq\u003d%22potterite%22 page 24\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Fungi in the forest and the surrounding area include names that would delight any \u0027\u0027Potterite\u0027\u0027: dead man\u0027s fingers, yellow brain fungus, dung roundhead, scarlet elfcup\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Caroline E. Richardson, \u0026quot;[http://www.commercialappeal.com/news/2007/Jul/21/fans-line-up-for-farewell-to-harry/ Fans line up for farewell to Harry]\u0026quot;, \u0027The Commercial Appeal\u0027, 21 July 2007\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Though it seemed that every \u0027\u0027Potterite\u0027\u0027 in line had their own theories about the future of Harry Potter, some weren\u0027t so certain about their own futures after finishing the book\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, C. D. Miller, \u0027Harry Potter Places Book Four — NEWTs: Northeastern England Wizarding Treks\u0027, First Edition Design Publishing (2012), ISBN 9781622870257, [http://books.google.com/books?id\u003dpEvGyeU-l9gC\u0026amp;pg\u003dPT10\u0026amp;dq\u003d%22every+potterite%22 unnumbered page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"It took more than three years of research, but we managed to find sixty-eight (68) Potter Places in the UK—specifically on the island of Great Britain. However, not all of these sites are places every \u0027\u0027Potterite\u0027\u0027 will enjoy\", \"priority\":7}]}, \"synonyms\":{}}");

	add("pottermaniac", "{\"term\":\"pottermaniac\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Potter|maniac|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who loves the \u0027\u0027 series of books and films\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Paul Grey, \u0026quot;[http://content.time.com/time/world/article/0,8599,2056149,00.html Harry\u0027s Magic is Back Again]\u0026quot;, \u0027Time\u0027, 24 July 2000\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"J. K. Rowling\u0027s Harry Potter and the Goblet of Fire (Bloomsbury; 636 pages) would have sold millions of copies had its publishers simply dumped them in bookstores, unannounced, and then got out of the way as word of mouth spread among stampeding \u0027\u0027Pottermaniacs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Bernard Cova, Robert Kozinets, \u0026amp; Avi Shankar, \u0027Consumer Tribes\u0027, Butterworth-Heinemann (2007), ISBN 9780750680240, [http://books.google.com/books?id\u003dDtOyShBakQ0C\u0026amp;pg\u003dPT293\u0026amp;dq\u003d%22Pottermaniacs%22 unnumbered page\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The launch of the fifth book, for instance, involved only one personal appearance, when JKR read extracts to 4,000 carefully selected \u0027\u0027Pottermaniacs\u0027\u0027 in the Albert Hall\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Peter Rainer, \u0026quot;[http://www.csmonitor.com/2007/0712/p99s01-almo.html \u0027Phoenix\u0027 rising: Harry Potter and the abridged tome]\u0026quot;, \u0027The Christian Science Monitor\u0027, 12 July 2007\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"If you are a \u0027\u0027Pottermaniac\u0027\u0027, this is the month for you. \u0026quot;Harry Potter and the Order of the Phoenix\u0026quot; opens today, and on July 21 the seventh and final Potter tome lands with a thud at your local bookstore\", \"priority\":7}]}, \"synonyms\":{}}");

	add("potterphile", "{\"term\":\"potterphile\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Potter|phile|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who loves the \u0027\u0027 series of books and films\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0026quot;[http://www.businessweek.com/stories/1999-08-08/childrens-books-just-wild-about-harry-potter Children\u0027s Books: Just Wild About Harry Potter]\u0026quot;, \u0027Businessweek\u0027, 8 August 1999\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Advance orders for the newest installment, Harry Potter and the Prisoner of Azkaban, which won\u0027t be in U.S. stores until September, have reached 920,000, though impatient \u0027\u0027Potterphiles\u0027\u0027 are ordering it from Britain via Amazon.com\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Ann Hornaday, \u0026quot;[http://www.washingtonpost.com/wp-dyn/content/article/2004/06/04/AR2005033112989.html Harry-Raising Adventure]\u0026quot;, \u0027The Washington Post\u0027, 4 June 2004\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In the interest of full disclosure, let it be said: This reviewer is not a \u0027\u0027Potterphile\u0027\u0027, has never cracked a Potter book or darkened the door of a theater playing one of the Potter movies\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Eric Nelson, \u0026quot;[http://www.csmonitor.com/The-Culture/Articles-on-Christian-Science/2011/1006/What-Harry-Potter-taught-me-about-evil What Harry Potter taught me about evil]\u0026quot;, \u0027The Christian Science Monitor\u0027, 6 October 2011\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"As every \u0027\u0027Potterphile\u0027\u0027 knows, there comes a time in Book Seven when Harry has to choose between two courses of action in his quest to deal with the evil Lord Voldemort\", \"priority\":7}]}, \"synonyms\":{}}");

	add("pottery", "{\"term\":\"pottery\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027poterie\u0027 {{defdate|13c.}}, from \u0027potier\u0027 (potter) from the root of \u0027pot\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Fired ceramic wares that contain clay when forme\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The shelves were lined with \u0027\u0027pottery\u0027\u0027 of all shapes and sizes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A potter\u0027s shop or workshop, where pottery is mad\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"I visited the old \u0027\u0027potteries\u0027\u0027 and saw the pots being made\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The potter\u0027s craft or art: making vessels from cla\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"W:Bernard Bernard Leach was skilled at \u0027\u0027pottery\", \"priority\":6}]}, \"synonyms\":{}}");

	add("pottle", "{\"term\":\"pottle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|potel}}, diminutive of {{m|fro|pot}}; see more at {{m|en|pot}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A former unit of volume, equivalent to half a gallon, used for liquids and corn; a pot of around this size\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Sir Walter Scott\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a dry \u0027\u0027pottle\u0027\u0027 of sack before hi\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Thomas Dekker\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027pottle\u0027\u0027 of Greek win\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A conical receptacle, typically for potato chips or other foodstuffs\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A pot or other receptacle, e.g. for strawberries\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Charles Dicken\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"He had a \u0027\u0027pottle\u0027\u0027 of strawberries in one hand\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, \u0027English Folktales\u0027 (ISBN 1591582601), page 21\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"quot;I was wondering whether you\u0027ve got such a thing as a \u0027\u0027pottle\u0027\u0027 of brains to spare?\u0026quot\", \"priority\":11}]}, \"synonyms\":{}}");

